import React from "react";
import styled from "styled-components";
import ModalEffect from "./ModalEffect";

/**
 * Modal View
 */
// SignIn
export const SignInModal = () => {
  return (
    <ModalEffect>
      <h2>로그인</h2>
      <InputSection>
        <form tabIndex={"id"}>
          <input type={"text"}></input>
        </form>
      </InputSection>

      <BtnSection></BtnSection>
    </ModalEffect>
  );
};
// SignUp
export const SignUpModal = () => {
  return (
    <ModalEffect>
      <h2>회원가입</h2>
    </ModalEffect>
  );
};

/**
 * Modal Style
 */
// Input
const InputSection = styled.div`
  width: 80%;
  height: 300px;
  background-color: blue;
  display: flex;
  /* position: absolute;
  top:0; */

`;
// Button
const BtnSection = styled.div`
  width: 80%;
`;
